class BankCard {
  int id;
  String name;
  String icon;

  BankCard({this.id, this.name, this.icon});

  BankCard.fromJson(Map<String, dynamic> json) {
    id = json['id'];
    name = json['name'];
    icon = json['icon'];
  }

  Map<String, dynamic> toJson() {
    final Map<String, dynamic> data = new Map<String, dynamic>();
    data['id'] = this.id;
    data['name'] = this.name;
    data['icon'] = this.icon;
    return data;
  }
}

class UserCard {
  int id;
  int userId;
  String bankcard;
  String deleteTime;
  String createTime;
  String bankcardType;
  BankCard bankType;
  String name;

  UserCard(
      {this.id,
      this.userId,
      this.bankcard,
      this.deleteTime,
      this.createTime,
      this.bankcardType,
      this.bankType,
      this.name});

  UserCard.fromJson(Map<String, dynamic> json) {
    id = json['id'];
    userId = json['user_id'];
    bankcard = json['bankcard'];
    deleteTime = json['delete_time'];
    createTime = json['create_time'];
    bankcardType = json['bankcard_type'];
    if (json['bankcard_type'] != null) {
      for (var item in bankList) {
        if (json['bankcard_type'] == item.name) {
          bankType = item;
        }
      }
    }
    name = json['name'];
  }

  Map<String, dynamic> toJson() {
    final Map<String, dynamic> data = new Map<String, dynamic>();
    data['id'] = this.id;
    data['user_id'] = this.userId;
    data['bankcard'] = this.bankcard;
    data['delete_time'] = this.deleteTime;
    data['create_time'] = this.createTime;
    data['bankcard_type'] = this.bankcardType;
    data['bankType'] = this.bankType.toJson();
    data['name'] = this.name;
    return data;
  }
}

